import { Routes, Route, Link } from "react-router-dom";
import Footer from "./components/Footer/Footer";
import "./styles.css";
import { Typography } from "@material-ui/core";
import Categories from "./components/Categories/Categories";
import About from "./components/About/About";
import FoodList from "./components/Food/FoodList";
import FoodDescription from "./components/Food/Food Item/FoodDescription";
import Navigation from "./components/Navigation/Navigation";
function App() {
  return (
    <main className="main">
      <div className="home-container">
        <div className="header">
          <Navigation />
          <div className="text-box">
            <Typography variant="h1">The Cafe Club</Typography>
            <Typography gutterBottom variant="subtitle1">
              Best Pizza in town!
            </Typography>
            <br />
            <Link to="/about">Learn More..</Link>
          </div>
        </div>

        <Routes>
          <Route path="/" element={<Categories />} />
          <Route path="/categories" element={<Categories />} />
          <Route
            path="/food-list/:categoryId/:categoryName"
            element={<FoodList />}
          />
          <Route path="/about" element={<About />} />
          <Route
            path="/food-description/:foodId"
            element={<FoodDescription />}
          />
        </Routes>
      </div>
      <Footer />
    </main>
  );
}

export default App;
